Note.create!([
  {title: "Facebook", body: "{\"ops\":[{\"attributes\":{\"size\":\"18px\",\"bold\":true,\"underline\":true},\"insert\":\"Front End Engineer\"},{\"attributes\":{\"size\":\"18px\",\"bold\":true},\"insert\":\" (Menlo Park, CA)\"},{\"insert\":\"\\n\\nFacebook was built to help people connect and share, and over the last decade our tools have played a critical part in changing how people around the world communicate with one another. With over a billion people using the service and more than fifty offices around the globe, a career at Facebook offers countless ways to make an impact in a fast growing organization.\\n\\nAre you interested in building products used by hundreds of millions of people? Do you like shipping code at a rapid pace? Facebook is seeking an experienced Front End Engineer that is passionate about building mobile and desktop web applications. This position is full-time and is based in our Menlo Park office.\\n\\n\"},{\"attributes\":{\"bold\":true,\"underline\":true},\"insert\":\"Responsibilities\"},{\"insert\":\"\\n\"},{\"attributes\":{\"color\":\"rgb(106, 113, 128)\",\"font\":\"'Freight Sans', 'Helvetica Neue', 'Segoe UI', 'Malgun Gothic', Meiryo, 'Microsoft JhengHei', helvetica, arial, sans-serif\"},\"insert\":\"Implement the features and user interfaces of Facebook products like News Feed\"},{\"attributes\":{\"bullet\":true},\"insert\":\"\\n\"},{\"attributes\":{\"color\":\"rgb(106, 113, 128)\",\"font\":\"'Freight Sans', 'Helvetica Neue', 'Segoe UI', 'Malgun Gothic', Meiryo, 'Microsoft JhengHei', helvetica, arial, sans-serif\"},\"insert\":\"Architect efficient and reusable front-end systems that drive complex web applications\"},{\"attributes\":{\"bullet\":true},\"insert\":\"\\n\"},{\"attributes\":{\"color\":\"rgb(106, 113, 128)\",\"font\":\"'Freight Sans', 'Helvetica Neue', 'Segoe UI', 'Malgun Gothic', Meiryo, 'Microsoft JhengHei', helvetica, arial, sans-serif\"},\"insert\":\"Collaborate with Product Designers, Product Managers, and Software Engineers to deliver compelling user-facing products\"},{\"attributes\":{\"bullet\":true},\"insert\":\"\\n\"},{\"attributes\":{\"color\":\"rgb(106, 113, 128)\",\"font\":\"'Freight Sans', 'Helvetica Neue', 'Segoe UI', 'Malgun Gothic', Meiryo, 'Microsoft JhengHei', helvetica, arial, sans-serif\"},\"insert\":\"Identify and resolve performance and scalability issues\"},{\"attributes\":{\"bullet\":true},\"insert\":\"\\n\"},{\"insert\":\"\\n\"},{\"attributes\":{\"bold\":true,\"underline\":true},\"insert\":\"Requirements\"},{\"insert\":\"\\n\"},{\"attributes\":{\"color\":\"rgb(106, 113, 128)\",\"font\":\"'Freight Sans', 'Helvetica Neue', 'Segoe UI', 'Malgun Gothic', Meiryo, 'Microsoft JhengHei', helvetica, arial, sans-serif\"},\"insert\":\"3+ years of JavaScript experience, including concepts like asynchronous programming, closures, types, and ES6. Experience with React is a bonus\"},{\"attributes\":{\"bullet\":true},\"insert\":\"\\n\"},{\"attributes\":{\"color\":\"rgb(106, 113, 128)\",\"font\":\"'Freight Sans', 'Helvetica Neue', 'Segoe UI', 'Malgun Gothic', Meiryo, 'Microsoft JhengHei', helvetica, arial, sans-serif\"},\"insert\":\"3+ years of HTML/CSS experience, including concepts like layout, specificity, cross browser compatibility, and accessibility\"},{\"attributes\":{\"bullet\":true},\"insert\":\"\\n\"},{\"attributes\":{\"color\":\"rgb(106, 113, 128)\",\"font\":\"'Freight Sans', 'Helvetica Neue', 'Segoe UI', 'Malgun Gothic', Meiryo, 'Microsoft JhengHei', helvetica, arial, sans-serif\"},\"insert\":\"3+ years experience with browser APIs and optimizing front end performance\"},{\"attributes\":{\"bullet\":true},\"insert\":\"\\n\"},{\"attributes\":{\"color\":\"rgb(106, 113, 128)\",\"font\":\"'Freight Sans', 'Helvetica Neue', 'Segoe UI', 'Malgun Gothic', Meiryo, 'Microsoft JhengHei', helvetica, arial, sans-serif\"},\"insert\":\"BS/MS in Computer Science or a related technical field preferred\"},{\"attributes\":{\"bullet\":true},\"insert\":\"\\n\"},{\"insert\":\"\\n\"}]}", author_id: 4, notebook_id: 9, shortcut: true},
  {title: "Google", body: "{\"ops\":[{\"attributes\":{\"font\":\"inherit\",\"size\":\"21px\"},\"insert\":\"Software Engineer (Robotics)\"},{\"insert\":\"\\n\\nGoogle engineers develop the next-generation technologies that change how users connect, explore, and interact with information and one another. As a member of an extraordinarily creative, motivated and talented team, you develop new products that are used by millions of people. We need our engineers to be versatile and passionate to tackle new problems as we continue to push technology forward. If you get excited about building new things and aren't daunted by the challenge of building something from scratch, then our team might be your next career step.\\n\\nAs a software engineer in Robotics, you will work on a small team, collaborating closely with project development teams in Robotics. We need our engineers to be versatile and passionate to tackle new problems. Because you’ll be working with cutting-edge technology, you’ll also get a chance to work closely with researchers across Google.\\n\\n\"},{\"attributes\":{\"color\":\"rgb(34, 34, 34)\",\"font\":\"Arial, Helvetica, sans-serif\",\"size\":\"16px\",\"bold\":true,\"underline\":true},\"insert\":\"Responsibilities\"},{\"insert\":\"\\nParticipate in cutting-edge research in robotics, vision and machine learning applications.\"},{\"attributes\":{\"bullet\":true},\"insert\":\"\\n\"},{\"insert\":\"Develop solutions for real-world, large-scale problems.\"},{\"attributes\":{\"bullet\":true},\"insert\":\"\\n\"},{\"insert\":\"\\n\"},{\"attributes\":{\"color\":\"rgb(34, 34, 34)\",\"font\":\"Arial, Helvetica, sans-serif\",\"size\":\"16px\",\"bold\":true,\"underline\":true},\"insert\":\"Minimum qualifications\"},{\"insert\":\"\\nBA/BS degree in Computer Science or related technical field or equivalent practical experience.\"},{\"attributes\":{\"bullet\":true},\"insert\":\"\\n\"},{\"insert\":\"\\n\"},{\"attributes\":{\"color\":\"rgb(34, 34, 34)\",\"font\":\"Arial, Helvetica, sans-serif\",\"size\":\"16px\",\"bold\":true,\"underline\":true},\"insert\":\"Preferred qualifications\"},{\"insert\":\"\\nMS or PhD degree in Computer Vision, Robotics or related technical field.\"},{\"attributes\":{\"bullet\":true},\"insert\":\"\\n\"},{\"insert\":\"Experience coding in C, C++ or Python.\"},{\"attributes\":{\"bullet\":true},\"insert\":\"\\n\"},{\"insert\":\"Strong background in one or more of the following areas: Machine Learning (e.g., Deep Learning), Robot Perception (e.g., Stereo Vision, SLAM, 3d Reconstruction), Manipulation, Motion Planning and Control.\"},{\"attributes\":{\"bullet\":true},\"insert\":\"\\n\"},{\"insert\":\"\\n\"},{\"attributes\":{\"color\":\"rgb(34, 34, 34)\",\"font\":\"Arial, Helvetica, sans-serif\",\"size\":\"16px\",\"bold\":true,\"underline\":true},\"insert\":\"Area\"},{\"insert\":\"\\n\\n\"},{\"attributes\":{\"color\":\"rgb(34, 34, 34)\",\"font\":\"Arial, Helvetica, sans-serif\"},\"insert\":\"Robotics is a growing area, as advances in perception and manipulation enable more\"},{\"insert\":\"\\n\"},{\"attributes\":{\"color\":\"rgb(34, 34, 34)\",\"font\":\"Arial, Helvetica, sans-serif\"},\"insert\":\"complex interactions between robots and the environment. Our group is dedicated to \"},{\"insert\":\"\\n\"},{\"attributes\":{\"color\":\"rgb(34, 34, 34)\",\"font\":\"Arial, Helvetica, sans-serif\"},\"insert\":\"making robots more accessible for real-world applications and finding places where \"},{\"insert\":\"\\n\"},{\"attributes\":{\"color\":\"rgb(34, 34, 34)\",\"font\":\"Arial, Helvetica, sans-serif\"},\"insert\":\"they can help relieve people from tedious tasks.\"},{\"insert\":\"\\n\"}]}", author_id: 4, notebook_id: 9, shortcut: true}
])
